<?php
class WMP_Works {
    public function __construct() {
        add_shortcode('wmp_map', [$this, 'wmp_map']);
        // search form filter ajax
        add_action('wp_ajax_wmp_form_ajac_filter', [$this, 'wmp_form_ajac_filter']);
        add_action('wp_ajax_nopriv_wmp_form_ajac_filter', [$this, 'wmp_form_ajac_filter']);
        // zip 1  filter filter ajax
        add_action('wp_ajax_wmp_form_zip1_filter', [$this, 'wmp_form_zip1_filter']);
        add_action('wp_ajax_nopriv_wmp_form_zip1_filter', [$this, 'wmp_form_zip1_filter']);
    }
    public function wmp_map() {
        echo self::wmp_map_area();
    }
    public function wmp_map_area() {
        $product_data = '';
        $paged = (get_query_var('paged')) ? get_query_var('paged') : 1;
        $query = new WP_Query(array(
            'post_type'      => 'product',
            'post_status'    => 'publish',
            'posts_per_page' => 10,
            'paged' => $paged,
            // 'tax_query'      => array( array(
            //     'taxonomy'   => 'product_cat',
            //     'field'      => 'term_id',
            //     'terms'      => array( get_queried_object()->term_id ),
            // ) )
        ));

        while ($query->have_posts()) {
            $query->the_post();
            $attributes = '';
            $product = wc_get_product(get_the_ID());
            if ($product->is_type('variable')) {
                foreach (wc_get_products(get_the_ID()) as $product) {
                    foreach ($product->get_attributes() as $attr_name => $attr) {
                        foreach ($attr->get_terms() as $term) {
                            $attributes .= '<option value="' . $term->term_id . '">' . $term->name . '</option>';
                        }
                    }
                }
                $product_data .= '<tr>
                                <td><img width="42px" src="' . get_the_post_thumbnail_url(get_the_ID(), 'thumbnail') . '"></td>
                                <td>' . get_post_meta(get_the_ID(), 'wmp_product_zip_code', true) . '</td>
                                <td>' . get_post_meta(get_the_ID(), 'wmp_product_city', true) . '</td>
                                <td>' . get_post_meta(get_the_ID(), 'wmp_product_pv_plant_size', true) . '</td>
                                <td>' . get_post_meta(get_the_ID(), 'wmp_product_pv_plant_value', true) . '</td>
                                <td><a href="" class="preview_button">Preview Now</a></td>
                                <td><select>' . $attributes . '</select></td>
                                <td>' . get_post_meta(get_the_ID(), '_price', true) . '</td>
                                <td>Buy Now</td>
                            </tr>';
            }
        }

        $html = '';
        $html .= '<div class="wmp_shop_wrapper">
